import React from 'react';
import { useNavigate } from 'react-router-dom';
import { LoadingButton } from '@mui/lab';

const Logout = () => {
    const navigate = useNavigate()
    return <button
        onClick = { e => {
            e.preventDefault()
            e.stopPropagation()
            localStorage.clear(e)
            navigate.push('/')
        }}> 로그아웃
    </button>}
    <LoadingButton
    fullWidth
    size="large"
    type="submit"
    variant="contained"
    loading={isSubmitting}>
    로그인
  </LoadingButton>

export default Logout
